package PDT::TS::Whois::UnicodeData;
use strict;
use warnings;
use 5.014;

use Carp;
use Exporter;

our @ISA = 'Exporter';
our @EXPORT = qw( is_word_char );

=head1 DESCRIPTION

Character property tests for Unicode 3.1.0.

=head2 %word_chars

The set of word characters.

=cut

my %word_chars;
while ( my $line = <DATA> ) {
    my ( $codepoint_string, undef, $category ) = split /;/, $line;
    my $codepoint = hex( $codepoint_string );
    unless ( $category =~ /^[PZC]/ ) {
        my $char = pack( 'U', $codepoint );
        $word_chars{$char} = 1;
    }
}

=head2 is_word_char( char )

Test if B<char> is a word character.

    is_word_char( '@' ) and croak "Symbols aren't word characters";
    is_word_char( 'A' ) or croak "Letters are word characters";

Returns true or false.  If B<char> is not a defined scalar the procedure dies
with a stacktrace.

=cut

sub is_word_char {
    my $char = shift;
    defined $char && ref $char eq '' or confess;

    return exists $word_chars{$char};
}

1;

=head2 __DATA__

A concatenation of two parts:

 1. A copy of http://www.unicode.org/Public/3.1-Update/UnicodeData-3.1.0.txt
 2. A transformation of http://www.unicode.org/Public/3.1-Update/Unihan-3.1.0.txt
    For each unique B<codepoint> listed in Unihan-3.1.0.txt a line is
    constructed with the codepoint number (without "U+") followed by the string
    ";;Lo".

=cut

